is_package: true
container:
  type: HtmlTemplate
  properties: {tooltip: '', background: 'theme:White', foreground: '', border: '',
    visible: true, role: null, html: '@theme:standard-page.html'}
  data_bindings: []
components:
- type: FlowPanel
  properties: {role: null, spacing: tiny, align: left, tooltip: '', border: '', foreground: '',
    visible: true, spacing_above: none, spacing_below: small, background: 'theme:White'}
  name: navbar_links
  layout_properties: {slot: nav-right, spacing_below: none}
  data_bindings: []
- type: Label
  properties: {role: headline, align: left, tooltip: '', border: '', foreground: 'theme:Primary
      700', visible: true, text: KCERT 2050 Carbon Calculator, font_size: 10, font: Arial,
    spacing_above: large, icon_align: left, spacing_below: large, italic: false, background: '',
    bold: true, underline: false, icon: ''}
  name: title
  layout_properties: {slot: title}
- type: ColumnPanel
  properties: {role: '2050', tooltip: '', border: '', foreground: 'theme:Primary 700',
    visible: true, wrap_on: mobile, col_spacing: none, spacing_above: none, col_widths: '{"BITUCV":5,"PKRSVT":48}',
    spacing_below: small, background: 'theme:White'}
  name: main_area
  layout_properties: {slot: default}
  components:
  - type: LinearPanel
    properties: {spacing_above: small, spacing_below: small, background: 'theme:Gray
        300', foreground: 'theme:Primary 700', border: '', visible: true, role: null,
      tooltip: ''}
    name: sliders_column
    layout_properties: {grid_position: 'GYKMWG,BITUCV', slot: left-nav, full_width_row: true}
    components:
    - type: FlowPanel
      properties: {role: null, spacing: tiny, align: left, tooltip: '', border: '',
        foreground: 'theme:Primary 700', visible: true, spacing_above: none, spacing_below: none,
        background: 'theme:White'}
      name: flow_panel_1
      layout_properties: {grid_position: 'GYKMWG,PKRSVT UNWGNJ,SDGZYG'}
      components:
      - type: Image
        properties: {role: null, vertical_align: center, height: 55, tooltip: '',
          border: '', foreground: '', visible: true, display_mode: shrink_to_fit,
          spacing_above: small, source: 'data:image/png;base64,',
          spacing_below: none, background: '', horizontal_align: center}
        name: image_2
        layout_properties: {width: 73}
      - type: Label
        properties: {role: null, align: left, tooltip: '', border: '', foreground: 'theme:Primary
            700', visible: true, text: 'KCERT 2050 Carbon Calculator

            Ministry of Energy Kenya', font_size: 19, font: 'sans-serif', spacing_above: small,
          icon_align: left, spacing_below: small, italic: false, background: '', bold: true,
          underline: false, icon: ''}
        name: label_1
        layout_properties: {}
    - type: ColumnPanel
      properties: {role: null, tooltip: '', border: '', foreground: 'theme:White',
        visible: true, wrap_on: mobile, col_spacing: medium, spacing_above: small,
        col_widths: '{"OXNENJ":30,"BHLNYW":30}', spacing_below: small, background: 'theme:Gray
          300'}
      name: pathways_card
      layout_properties: {grid_position: 'QSNDWO,JOEWHC'}
      components:
      - type: DropDown
        properties:
          role: null
          align: full
          tooltip: ''
          placeholder: Example Pathways
          border: ''
          enabled: true
          foreground: theme:Primary 700
          items: []
          visible: true
          font_size: 14
          font: ''
          spacing_above: small
          spacing_below: none
          italic: false
          background: theme:White
          bold: false
          underline: false
          include_placeholder: true
        name: pathways_dropdown
        layout_properties: {grid_position: 'PLRDHP,OXNENJ'}
        event_bindings: {change: pathways_dropdown_change}
      - type: Button
        properties: {role: null, align: center, tooltip: '', border: '', enabled: true,
          foreground: '', visible: true, text: '', font_size: 30, font: '', spacing_above: none,
          icon_align: left, spacing_below: none, italic: false, background: '', bold: false,
          underline: false, icon: 'data:image/png;base64,'}
          
        name: button_1
        layout_properties: {grid_position: 'PLRDHP,PIIPPV'}
        event_bindings: {click: button_1_click, show: button_1_click}  
        
      - type: Button
        properties: {role: primary-color, align: center, tooltip: '', border: '',
          enabled: true, foreground: 'theme:White', visible: true, text: Reset Levers,
          font_size: 15, font: '', spacing_above: small, icon_align: left, spacing_below: small,
          italic: false, background: 'theme:Primary 700', bold: false, underline: false,
          icon: ''}
        
        name: reset_button
        layout_properties: {grid_position: 'PLRDHP,BHLNYW'}
        event_bindings: {click: reset_button_click, show: reset_button_show}
    - type: XYPanel
      properties: {role: bottom-border, width: null, align: center, height: '32',
        tooltip: '', border: '', foreground: '', visible: true, spacing_above: small,
        spacing_below: none, background: 'theme:Gray 300'}
      name: settings_title_card
      layout_properties: {}
      components:
      - type: Label
        properties: {role: subheading, align: left, tooltip: '', border: '', foreground: 'theme:Primary
            700', visible: true, text: 'Lever Settings:', font_size: null, font: '',
          spacing_above: small, icon_align: left, spacing_below: small, italic: false,
          background: '', bold: true, underline: false, icon: ''}
        name: col1_label
        layout_properties: {x: 43, y: 0, width: 140}
      - type: Label
        properties: {role: subheading, align: left, tooltip: '', border: '', foreground: 'theme:Primary
            700', visible: true, text: Level of Ambition, font_size: null, font: '',
          spacing_above: small, icon_align: left, spacing_below: small, italic: false,
          background: '', bold: true, underline: false, icon: ''}
        name: col2_label
        layout_properties: {x: 250, y: 0, width: 140}
    - type: RepeatingPanel
      properties: {role: 'lever-panel', tooltip: '', border: '', foreground: 'theme:White',font_size: 10,
        items: null, visible: true, spacing_above: none, spacing_below: none, item_template: Main.LeverGroup,
        background: 'theme:Primary 700'}
      name: lever_group_panel
      layout_properties: {grid_position: 'IPNHGZ,SIGQFA', full_width_row: false}
      data_bindings: []
      event_bindings: {}
    - type: Button
      properties: {role: primary-color, align: center, tooltip: '', border: '', enabled: true,
        foreground: '', visible: true, text: Switch to 2100 Mode, font_size: 13,
        font: 'sans-serif', spacing_above: none, icon_align: left, spacing_below: small, italic: false,
        background: 'theme:Primary 700', bold: true, underline: false, icon: ''}
      name: expert_toggle
      layout_properties: {grid_position: 'LRIAJT,HLZOEC'}
      event_bindings: {click: expert_toggle_click}
  - type: LinearPanel #general area layout changed to white
    properties: {spacing_above: none, spacing_below: medium, background: '', foreground: 'theme:White', border: '', visible: true, role: null, tooltip: ''}
    name: plot_area
    layout_properties: {grid_position: 'GYKMWG,PKRSVT', full_width_row: true}
    components: []
- type: Image
  properties: {role: null, vertical_align: center, height: 60, tooltip: '', border: '',
    foreground: '', visible: true, display_mode: shrink_to_fit, spacing_above: small,
    source: 'data:image/png;base64,',
    spacing_below: small, background: '', horizontal_align: center}
  name: image_1
  layout_properties: {slot: top-left-btn}
